import React, { Component } from "react";
class RadioInput extends Component {
  state = {};
  render() {
    return (
      <input
        class="form-check-input mt-0"
        type="radio"
        value=""
        aria-label="Radio button for following text input"
      />
    );
  }
}

export default RadioInput;
